@Philiplassitermusic brengt zijn negenkoppige soul- en funkband Philthy deze zaterdag naar @HanzeArtStation! Philip was o.a. leider en arrangeur van Prince’s blazerssectie New Power Generation, stond wereldwijd op de grootste festivals zoals Essence Festival, Montreux Jazz Festival en dit jaar nog North Sea Jazz en won meer Grammy’s dan je in twee handen kan vasthouden. 🏆🤪

Tickets zijn verkrijgbaar via www.hanzeartstation.nl

#Philthy #PhilipLassiter #Lassiter #Funk #Prince #HanzeArtStation #Spoorzone #Zwolle #HanzestadZwolle #Music #Concert
